import Header from './Header'

const layoutStyle = {
  margin: 20
}

const Layout = props => (
  <div style={layoutStyle}>
    <Header />
    {props.children}
    <style jsx global>{`
      body {
        background: #000;
        font: 11px menlo;
        color: #fff;
      }
    `}</style>
  </div>
)

export default Layout
